import * as React from 'react'

import {  Button } from 'react-bootstrap';

interface Props {
  text: string
}

export const ExampleComponent = ({ text }: Props) => {
  return <div>
     <div className="">Example Component: {text}</div> 
     <Button variant="secondary">Hello</Button>
  </div>
}
